import React, { useState } from 'react';
import Modal from 'react-modal';
import MypageOption from './MypageOption';
import { BottomWrapper, PostPreview } from './MypagePostStyle';
import preveiw from '../../assets/img/profile.jpg';
import Post from '../post/Post';

const MypagePost: React.FC = () => {
  const [isOpen, setIsOpen] = useState(false);
  const onClick = () => {
    setIsOpen(true);
  };
  const dummy = [];
  return (
    <>
      <MypageOption />
      <BottomWrapper>
        <Modal
          isOpen={isOpen}
          onRequestClose={() => setIsOpen(false)}
          style={{
            overlay: {
              position: 'fixed',
              top: 0,
              left: 0,
              right: 0,
              bottom: 0,
              backgroundColor: 'rgba(0, 0, 0, 0.75)',
            },
            content: {
              position: 'absolute',
              top: '100px',
              left: '100px',
              right: '100px',
              bottom: '100px',
              background: '#fff',
              overflow: 'auto',
              WebkitOverflowScrolling: 'touch',
              borderRadius: '4px',
              outline: 'none',
              padding: '20px',
              display: 'flex',
              justifyContent: 'center',
            },
          }}
        >
          <Post />
        </Modal>
        <PostPreview src={preveiw} onClick={onClick} />
        <PostPreview src={preveiw} />
        <PostPreview src={preveiw} />
        <PostPreview src={preveiw} />
        <PostPreview src={preveiw} />
      </BottomWrapper>
    </>
  );
};

export default MypagePost;
